import { Component, OnInit } from '@angular/core';
import { FaceSnap } from './models/face-snap.model';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {

  ShepSnap!: FaceSnap;
  ThaneSnap!: FaceSnap;
  GarrusSnap!: FaceSnap;


  ngOnInit() {
    this.ShepSnap=new FaceSnap(
      'John Shepard',
      'Normandy\'s Commander',
      'https://i.pinimg.com/564x/57/c1/71/57c171b8fd242ca1d6ced472250b3ef4.jpg',
      new Date(),
      0,
      'SR2-Normandy Captain'
    );
    this.ThaneSnap=new FaceSnap(
      'Thane Krios',
      'Skilled Assassin',
      'https://i.pinimg.com/564x/0e/c0/54/0ec054af0902a92cfd4ec457cd7ddc7e.jpg',
      new Date(),
      0
    );
    this.GarrusSnap=new FaceSnap(
      'Garrus Vakarian',
      'Need some calibration',
      'https://i.pinimg.com/564x/b2/0c/50/b20c50ac30f88e9554cbbdb46a1f4e89.jpg',
      new Date(),
      0
    );

  }
}
